HRESULT initrd_init()
{

	/* Create initial directory infrastructure */
	k_mkdir("/dev", NODE_MODE_ALL_RWE);
	k_mkdir("/home", NODE_MODE_ALL_RWE);
	k_mkdir("/temp", NODE_MODE_ALL_RWE);
	k_mkdir("/ipc", NODE_MODE_ALL_RWE);
	k_mkdir("/drives", NODE_MODE_ALL_RWE);

	int i = 0;

	while (files[i].filename != NULL) {
		HRESULT hr;

		/* Create file */
		hr = k_fcreate(files[i].filename, NODE_MODE_ALL_RWE);
		if (FAILED(hr)) {
			HalKernelPanic("Failed to create initrd file.");
		}

		/* Open file */
		K_STREAM *f;
		hr = k_fopen(files[i].filename, FILE_OPEN_WRITE, &f);
		if (FAILED(hr)) {
			HalKernelPanic("Failed to open initrd file for writing.");
		}

		/* Write content */
		size_t bytes;
		size_t size = files[i].size != 0 ? files[i].size : strlen(files[i].content)+1;
		k_fwrite(f, size, files[i].content, &bytes);

		if (bytes != size) {
			HalKernelPanic("Failed to create ramdisc file.");
		}

		/* Close */
		hr = k_fclose(&f);
		if (FAILED(hr)) {
			HalKernelPanic("Failed to close initrd file.");
		}

		i++;
	}

	return S_OK;
}


void test_file_io() {
	HRESULT hr;

	hr = k_mkdir("/anton", NODE_MODE_ALL_RWE);
	if (FAILED(hr)) {
		vga_printf("failed to create directory '/anton'\n");
		return;
	}

	hr = k_fcreate("/anton/file1", NODE_MODE_ALL_RWE);
	if (FAILED(hr)) {
		vga_printf("failed to create file\n");
		return;
	}

	K_STREAM *f;
	uint32_t bytes;

	hr = k_fopen("/anton/file1", FILE_OPEN_WRITE, &f);

	if (FAILED(hr)) {
		vga_printf("failed to open file\n");
		return;
	}

	hr = k_fwrite(f, 5, "abcd", &bytes);
	if (FAILED(hr) || bytes != 5) {
		vga_printf("failed to write to file\n");
		return;
	}
	vga_printf("after write\n");

	k_fclose(&f);

	/* Read-back from file */
	hr = k_fopen("/anton/file1", FILE_OPEN_READ, &f);

	if (FAILED(hr)) {
		vga_printf("failed to open file\n");
		return;
	}

	char buff[1024];
	hr = k_fread(f, 1024, buff, &bytes);
	if (FAILED(hr)) {
		vga_printf("failed to read from file\n");
		k_fclose(&f);
		return;
	}
	vga_printf("file: %s\ncontent: %s\n---\n", "/anton/file1", buff);

	k_fclose(&f);

	/* Read another file (from initrd) */
	hr = k_fopen("/home/welcome", FILE_OPEN_READ, &f);

	if (FAILED(hr)) {
		vga_printf("failed to open file\n");
		return;
	}

	hr = k_fread(f, 1024, buff, &bytes);
	if (FAILED(hr)) {
		vga_printf("failed to read from file\n");
		k_fclose(&f);
		return;
	}
	vga_printf("file: %s\ncontent: %s\n---\n", "/home/welcome", buff);

	k_fclose(&f);

}
